import { StyleSheet } from "react-native"

const styles = StyleSheet.create({

    containerFilms: {
        paddingTop: 10,
        paddingBottom: 16,
        paddingRight: 16,
        width: 140
    },
    titleFilms: {
        color: '#fff',
        fontSize: 12,
        paddingTop: 8
    },
    feedbackFilms: {
        fontSize: 10,
        color: '#fff',
        paddingLeft: 4
    },
    imageFilms: {
        marginTop: 10,
        width: '100%',
        height: 170,
        borderRadius: 8
    }

})

export default styles
